--
-- Name: books_with_subject_names; Type: VIEW; Schema: public; Owner: EmmaFerguson
--

CREATE VIEW books_with_subject_names AS
 SELECT library.book_id,
    library.title,
    library.author,
    library.pub_year,
    library.original_pub_year,
    library.pages,
    library.publisher,
    library.language,
    book_subjects.subject_id,
    subjects.subject
   FROM ((library
     JOIN book_subjects USING (book_id))
     JOIN subjects USING (subject_id));


