--
-- Name: most_used_subjects; Type: VIEW; Schema: public; Owner: EmmaFerguson
--

CREATE VIEW most_used_subjects AS
 SELECT count(book_subjects.subject_id) AS count,
    subjects.subject,
    book_subjects.subject_id
   FROM (book_subjects
     LEFT JOIN subjects USING (subject_id))
  GROUP BY subjects.subject, book_subjects.subject_id
 HAVING (count(book_subjects.subject_id) > 10)
  ORDER BY count(book_subjects.subject_id) DESC;


